import React, { useState } from 'react';
import './Dashboard.css';

function Dashboard({ userName, onLogout }) {
  const [selectedMood, setSelectedMood] = useState(null);
  const [selectedIssue, setSelectedIssue] = useState(null);

  const moods = [
    { key: 'fantastic', emoji: 'ðŸ˜„', label: 'Fantastic' },
    { key: 'good', emoji: 'ðŸ˜Š', label: 'Good' },
    { key: 'bad', emoji: 'ðŸ˜•', label: 'Bad' },
    { key: 'depressed', emoji: 'ðŸ˜¢', label: 'Depressed' },
  ];

  const issues = [
    'Academic Pressure',
    'High Expectations from Parents',
    'Comparison with Others',
    'Fear of Failure',
    'Social Media Pressure',
    'Lack of Proper Sleep',
    'Loneliness',
    'Bullying or Negative Comments',
    'Career Confusion',
    'Poor Time Management',
    'Lack of Emotional Expression',
    'Overuse of Mobile Phones & Gaming',
    'Financial & Family Problems',
    'Overthinking'
  ];

  const suggestions = {
    'Academic Pressure': [
      'Break subjects into small daily goals instead of studying everything at once.',
      'Use study timers (25â€“30 min focus + short break).'
    ],
    'High Expectations from Parents': [
      'Set realistic goals, not perfect goals.',
      'Focus on improvement, not only marks.'
    ],
    'Comparison with Others': [
      'Track your personal progress, not others\' scores.',
      'Limit social media during exams.'
    ],
    'Fear of Failure': [
      'Treat mistakes as learning experiences.',
      'Plan a backup strategy instead of overthinking.'
    ],
    'Social Media Pressure': [
      'Reduce screen time.',
      'Follow educational or positive content instead of stressful content.'
    ],
    'Lack of Proper Sleep': [
      'Maintain fixed sleep timing (7â€“8 hours).',
      'Avoid mobile phones at least 30 minutes before sleep.'
    ],
    'Loneliness': [
      'Join clubs, group studies, or activities.',
      'Talk regularly with friends or family.'
    ],
    'Bullying or Negative Comments': [
      'Talk to a trusted teacher or counselor.',
      'Avoid engaging with negative people online/offline.'
    ],
    'Career Confusion': [
      'Explore interests through small projects or internships.',
      'Take guidance from seniors or mentors.'
    ],
    'Poor Time Management': [
      'Use a simple daily planner.',
      'Prioritize tasks: Important â†’ Normal â†’ Later.'
    ],
    'Lack of Emotional Expression': [
      'Talk to someone you trust about your feelings.',
      'Try journaling or creative activities (art, music, writing).'
    ],
    'Overuse of Mobile Phones & Gaming': [
      'Set daily app time limits.',
      'Replace some screen time with hobbies or sports.'
    ],
    'Financial & Family Problems': [
      'Talk to family members about concerns in a calm manner.',
      'Seek guidance from a school counselor for support.'
    ],
    'Overthinking': [
      'Practice mindfulness or meditation.',
      'Write down worries and focus on actionable steps only.'
    ]
  };


  return (
    <div className="db-container">
      <header className="db-header">
        <h1>MindMate</h1>
        <button className="db-logout" onClick={onLogout}>Logout</button>
      </header>
      <p className="db-welcome">Welcome, <strong>{userName}</strong>!</p>
      <div className="db-question">How are you feeling today?</div>
      <div className="db-moods">
        {moods.map(m => (
          <button
            key={m.key}
            className={`db-mood ${selectedMood === m.key ? 'selected' : ''}`}
            onClick={() => setSelectedMood(m.key)}
          >
            <span className="emoji">{m.emoji}</span>
            <span className="label">{m.label}</span>
          </button>
        ))}
      </div>
      {selectedMood && (
        <div className="db-selected">You selected <strong>{selectedMood}</strong></div>
      )}

      {(selectedMood === 'bad' || selectedMood === 'depressed') && (
        <div className="db-issues-section">
          <h3>What's bothering you?</h3>
          <div className="db-issues-grid">
            {issues.map((issue, idx) => (
              <button
                key={idx}
                className={`db-issue ${selectedIssue === issue ? 'selected' : ''}`}
                onClick={() => setSelectedIssue(issue)}
              >
                {issue}
              </button>
            ))}
          </div>
          {selectedIssue && (
            <div className="db-issue-selected">
              You mentioned: <strong>{selectedIssue}</strong>
            </div>
          )}

          {selectedIssue && suggestions[selectedIssue] && (
            <div className="db-suggestions">
              <h4>Here are some helpful tips:</h4>
              <ul className="db-suggestions-list">
                {suggestions[selectedIssue].map((tip, idx) => (
                  <li key={idx}>{tip}</li>
                ))}
              </ul>
            </div>
          )}
        </div>
      )}
    </div>
  );
}

export default Dashboard;
